import React from 'react';

function PetDetails({ isPetSelected, onPetSelection, selectedPetPk}) {
	console.log(isPetSelected);
	return(
		<div>
			<p className='pointer tl' onClick={onPetSelection}>{selectedPetPk}</p>
		</div>
	) 
}

export default PetDetails;
